部屋干しトップ ワンパック 25g*5袋入り<br>ブランド：トップ<br>販売・製造元：ライオン<br><br>部屋干し時の『生乾きのイヤなニオイ』に加え、衣類が再び湿ると感じる『もどり生乾き臭』まで防ぐ粉末衣料用洗剤です。<br>「活性ジンクイオン」、「ダブル分解酵素」、「除菌成分」が、汚れと菌に働いて、部屋干し時の生乾きのイヤなニオイを防止。<br>さらに「活性ジンクイオン」が、部屋干しした衣類を着たとき、湿ると再び感じられる「もどり生乾き臭」まで防ぎます。<br>すっきりとしたシトラスフルーティの香り。<br>旅行やコインランドリーなどに便利な25gワンパックタイプ。<br> <br>使用量の目安              使用量の目安               洗濯物量の目安               水量の目安                    1包(25g)               1.5kg               30L                    2包(50g)               3.5kg               50L      ●手洗いの場合は3g(料理用小さじ約1杯)を洗面器(水約3L)に溶かす。<br>  ●洗剤の使用量は洗濯物の量と汚れの程度によって加減しましょう。<br> 用途綿・麻・合成繊維のお洗濯用 お洗濯方法(1)衣類の絵表示を確認洗える衣類・・・綿、麻、合成繊維洗えない衣類・・・中性表示のもの(毛・絹など)、水洗いできないもの(2)色落ちが心配な衣類は、色落ちを確認濃いめの洗剤液(少量の水で溶く)を目立たない所につけて5分おく。<br>変色や色落ちをしたら洗えません。<br>(3)洗剤と衣類を洗濯機に入れる。<br>●洗剤を衣類に直接ふりかけない。<br>(溶け残り・蛍光ムラ・退色の原因になる)●洗剤が1ヶ所にかたよらないよう、注水のタイミングや洗剤投入ケース等を上手に利用し、洗剤を水によく溶かす。<br>●一度に洗える洗濯物量の目安は洗濯機の大きさの約3/4まで。<br>●ランジェリーなどのデリケートな衣類は洗濯ネットを使用。<br>●すすぎは2回をおすすめします。<br>※きなりや淡い色の衣類は、蛍光増白剤の入っていない洗剤(トップNANOX、アクロン等)をお使いください。<br>※漂白剤を併用する場合は、酸素系漂白剤(手間なしブライト等)をお使いください。<br> <br><br>使用上の注意<br>●乳幼児の手の届かないところに置かない。<br>●用途外に使わない。<br>●使用後は手を水でよく洗い、クリームなどで手入れをする。<br>●荒れ性の方や洗剤をブラシにつけて洗うときは炊事用の手袋を使用する。<br> 応急処置●飲み込んだ時は水又は牛乳を飲ませる。<br>●目に入ったときはこすらずすぐに水で充分洗い流す。<br>●異常があるときは商品を持参し、医師に相談する。<br> 液性弱アルカリ性 成分界面活性剤(17% アルファスルホ脂肪酸エステルナトリウム、純石けん分(脂肪酸ナトリウム)、ポリオキシエチレンアルキルエーテル)、水軟化剤(アルミノけい酸塩)、アルカリ剤(炭酸塩、重炭酸塩)、工程剤(硫酸塩)、漂白剤、蛍光増白剤、酵素<br> 原産国日本 <br><br>お問い合わせ先<br>ライオン株式会社0120-556-973 <br>日用品／洗濯用品／洗濯洗剤／粉末洗剤 衣類用<br>JANコード： 4903301169345<br><br>CS：80<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
