ランド：ブルーダイヤ<br>原産国：日本<br><br>汗、皮脂など体から出るニオイや汚れをしっかり落とす<br>ニオイの元となる、からだから出る「タンパク汚れ」を酵素が分解し、漂白成分が衣類に染み付いたニオイもシミもしっかり分解除去して、衣類をすっきりと洗い上げる衣料用粉末洗剤。タンパク分解酵素と、漂白成分で、汗・皮脂のニオイをもとから消します。加齢臭消臭成分配合。フラボノイド成分配合。重なり合った衣類のすきまに入り込んでもサッと溶ける、スプラッシュパウダー。すがすがしいクリアミントの香り。<br>使用方法：お洗濯方法\n１衣類の絵表示を確認\n　洗える衣類　綿、麻、合成繊維\n　洗えない衣類　弱30中性、手洗イ30中性、中性表示のもの(毛・絹など)、水洗いできないもの\n２色落ちが心配な衣類は、色落ちを確認\n　●濃いめの洗剤液(少量の水で溶く)を目立たない所につけて5分おく→変色や色落ちをしたら洗えません。\n３洗剤と衣類を洗濯機に入れる\n　●洗剤を衣類に直接ふりかけない。(溶け残り・退色の原因になる)\n　●洗剤が1ヶ所にかたよらないよう、注水のタイミングや洗剤投入ケース等を上手に利用し、洗剤を水によ<br><br>JANコード:4903301254805<br><br><br>商品番号：101-00977<br><br><br><br>区分: 洗剤・柔軟剤 <br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
